// Read actual speed
Actual speed is the next word after the status word so we add 2 to our address
iActualSpeed := WORD_TO_INT(PIW[iInAddress + 2]);

since the value is scaled to a word, 100% = 16383
If the word reads 16383 we divide by 163.83 to get 100 or 100% If the word reds 1638 we divide by 163.83 to get 9.998 or 10%
